import React from 'react'
import './Journal.css'
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';


export default function Journal({user}) {
    return (
    <div className="journal__wrapper">

  <div className="journal__inputBox">

	  <textarea className="journal__input" type="text" placeholder="My day was so productive..."/>
    <button className="journal__inputButton"><b>ADD NOTE</b></button>
  </div>
        <div className="journal__chart">
          {

      <div>
        <Calendar
          value={new Date()}
          onChange={(value, event) => console.log('New date is: ', event.target.value)}
        />
      </div>

  }

        </div>

    </div>
    )


}
